import React from 'react';

function SocialItem(props) {
  return (
    <>
      <div className='social-item'>
        <div className='social-item-icon'>
          <i className={'fab ' + props.icon} />
        </div>
        <div className='social-text'>
          {props.text}
        </div>
      </div>
    </>
  );
}

export default SocialItem;
